import { Suspense, lazy, ElementType } from 'react';
import { Navigate, useRoutes, useLocation } from 'react-router-dom';
// layouts
import DashboardLayout from './layouts/dashboard';
import LogoOnlyLayout from './layouts/LogoOnlyLayout';
// components
import PageOne from './pages/PageOne';
import Page404 from './pages/Page404';

// ----------------------------------------------------------------------

 //currentUser ? <Component {...props} /> : <Redirect to="/login" />

export default function Router() {
  return useRoutes([
    //public or private routes
    {
      path: '/',
      element: <DashboardLayout />,
      children: [
        { path: 'one', element: <PageOne /> },
        { path: 'two', element: <PageOne /> },
        { path: 'three', element: <PageOne /> },
        {
          path: '/user',
          children: [
            { element: <Navigate to="/user/four" replace />, index: true },
            { path: '/user/four', element: <PageOne /> },
            { path: '/user/five', element: <PageOne /> },
            { path: '/user/six', element: <PageOne /> },
          ],
        },
      ],
    },
    //public only routes
    {
      path: 'registration',
      element: <LogoOnlyLayout />,
      children: [
        { element: <Navigate to="signup" replace />, index:true},
        { path: 'signup', element: <PageOne /> },
        { path: 'login', element: <PageOne/> },
      ],
    },
    //private only routes
    { path: 'myprofile', element: <DashboardLayout /> },
    { path: 'myaccount', element: <LogoOnlyLayout/>, children: [
        { path: 'settings', element: <PageOne /> },
      ]
    },
    //404
    {
      path: '*',
      element: <LogoOnlyLayout />,
      children: [
        { path: '404', element: <Page404 /> },
        { path: '*', element: <Navigate to="/404" replace /> },
      ],
    },
  ]);
}
